¡EN FOTOS!

#05May|#Apure| ¡A CASA LLENA! se realizó extraordinaria asamblea con vecinos de la población de El Nula, parroquia San Camilo, municipio Páez.

Este domingo #05May en la población de El Nula, el Comando de Campaña CONVZLA de María Corina Machado y Edmundo González en el municipio Páez realizó masiva asamblea con habitantes de la parroquia San Camilo.

La concurrida actividad estuvo integrada por miembros de Vente Venezuela, la Plataforma Unitaria y sociedad civil quienes de manera muy expresiva manifestaron su compromiso con el rescate de la democracia y lograr el triunfo de María Corina Machado y Edmundo González.

Nahír Mota Directora Regional del Comando de Campaña CONVZLA en Apure manifestó que luego de pasar por los estados Barinas, Táchira hasta llegar a la parroquia San Camilo para ver tantos anhelos de libertad sin dudas nos llenan de mayor entusiasmo 

Mota también destacó la presencia de dirigentes políticos reconocidos del vecino estado Táchira quienes en representación del Dr. Cesar Pérez Vivas se hicieron presentes reafirmando el compromiso de todos ellos con el proyecto de María Corina Machado y Edmundo González, todos juntos #HastaElFinal

